import styled from "styled-components";

const Container = styled.div

export function CounterState() {

    let count = 0;
    function minus() {
        count = count - 1;
    }
    function plus() {
        count = count + 1;
    }

    return (<>
        <Container>
            <h1>{count}</h1>
            <button onClick={minus}>-</button>
            <button onClick={plus}>+</button>
        </Container>
    </>);
}
